import React from 'react';

export default function Journey({ steps }) {
  return (
    <section className="journey-row">
      <div className="container">
        <div className="row gy-4 gx-4 justify-content-center align-items-center">
          {steps.map((step, idx) => (
            <div key={idx} className="journey-col medium-3 small-12 large-3">
              <p className="big-number">{step.number}</p>
              <div className="glass-box">
                <p className="big-text">{step.title}</p>
                <p className="small-text">{step.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
